                attr.bg &= ~(BufferLine_1.Attributes.CM_MASK | BufferLine_1.Attributes.RGB_MASK);
                attr.bg |= BufferLine_1.DEFAULT_ATTR_DATA.bg & (BufferLine_1.Attributes.PCOLOR_MASK | BufferLine_1.Attributes.RGB_MASK);
