                    attr.bg |= BufferLine_1.Attributes.CM_RGB;
                    attr.bg &= ~BufferLine_1.Attributes.RGB_MASK;
                    attr.bg |= BufferLine_1.AttributeData.fromColorRGB([params[i], params[i + 1], params[i + 2]]);
