                    p = params[i] & 0xff;
                    attr.bg &= ~(BufferLine_1.Attributes.CM_MASK | BufferLine_1.Attributes.PCOLOR_MASK);
                    attr.bg |= BufferLine_1.Attributes.CM_P256 | p;
